const BASE_HEIGHT = 722;

function getCoordinates(isAndroid = false, newSize, callBack) {
    const FILTER_VALUE = isAndroid ? 95: 125;
    var source_canvas = document.createElement("canvas");
    var source_context = source_canvas.getContext("2d");
    var coordinates = [];

    var img = new Image();
    img.src = isAndroid
        ? "data:image/png;base64,"
        : "data:image/png;base64,";

    img.onload = () => {
        if (isAndroid) {
            source_canvas.width = newSize;
            source_canvas.height = newSize * (img.height / img.width);
        } else {
            newSize = newSize * (img.height / BASE_HEIGHT);
            source_canvas.width = newSize * (img.width / img.height);
            source_canvas.height = newSize;
        }

        source_context.drawImage(img, 0, 0, source_canvas.width, source_canvas.height);
        callBack(filterPixels());
    }

    function filterPixels() {
        let imgData = source_context.getImageData(0, 0, source_canvas.width, source_canvas.height);
        let i;
        coordinates = [];
    
        for (i = 0; i < imgData.data.length; i += 4) {
            let y = Math.floor(i / (4 * source_canvas.width));
            if (imgData.data[i + 3] != 0
            && imgData.data[i] < FILTER_VALUE
            && imgData.data[i + 1] < FILTER_VALUE
            && imgData.data[i + 2] < FILTER_VALUE) {
    
            let x = Math.floor(i / 4) - (y * source_canvas.width);
            coordinates.push([x, y]);
            }
        }
    
        return coordinates;
    }
}